import {GET_PODCAST} from './actionTypes';
import axios from 'axios';

export const fetchPodcasts = () => async(dispatch) => {

  const podcast = await axios.get('/podcast');
  console.log("called");
  podcast.catch(e => {
    return console.log(e)
  });


dispatch({
  type: GET_PODCAST,
  payload: podcast
});
};
